import c from './EmojiMenu.module.css'
import { useState } from 'react';

function EmojiButton({ emoji }) {
    function setEmoji(e) {
        this.innerHTML = emoji;
    }

    return(
        <button onLoad={setEmoji} className={c.emojiButton}>{}</button>
    );
}

export default EmojiButton;
